using BlazorDemo.Sudoku;
using System;
using System.Collections.Generic;
using System.Linq;
using System.Text;
using Xunit;

namespace BlazorDemoTests.Sudoku
{
    public class BoardTests
    {
        [Theory]
        [MemberData(nameof(validPuzzles))]
        public void TrySolve_ValidPuzzles(string data)
        {
            // Arrange.
            string[] split = data.Split(',');
            var puzzle = ToByteArray(split[0]);
            var solution = ToByteArray(split[1]);

            var board = new Board(puzzle);
            Assert.True(board.Validate());

            // Act.
            Assert.True(board.TrySolve());

            // Assert.
            Assert.True(board.Validate());
            Assert.Equal(solution, board.values);
        }

        [Theory]
        [MemberData(nameof(invalidPuzzles))]
        public void Validate_InvalidPuzzles(string data)
        {
            // Arrange.
            var puzzle = ToByteArray(data);
            var board = new Board(puzzle);

            // Act + Assert.
            Assert.False(board.Validate());
            Assert.False(board.TrySolve());
        }

        [Fact]
        public void Validate_EmptyBoard()
        {
            // Arrange.
            var board = Board.New();

            // Act + Assert.
            Assert.True(board.Validate());
        }

        private byte[] ToByteArray(string data)
        {
            return data.Where(c => char.IsDigit(c)).Select(c => (byte)(c - '0')).ToArray();
        }

